import React from "react"; 
import Header from "./Header";
import Container from 'react-bootstrap/Container'; 

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
      </header>
      <Container className = "home" style = {{ marginTop:'-15%',paddingTop: '10%'}}>
      </Container>
    </div>
  );
}

export default App;
